CREATE PROCEDURE public.nombreapellido(IN nombrecompleto character varying, OUT nombre character varying, OUT apellido character varying)
    LANGUAGE plpgsql
    AS $$
declare
	ind integer;
begin
	ind = position(' ' in nombreCompleto);
	if ind = 0 then
		-- Solo viene el nombre, no hay apellido:
		nombre = nombreCompleto;
		apellido = '';
		
	else
		nombre = substring(nombreCompleto, 1, ind-1);
		apellido = substring(nombreCompleto, ind+1);
	
	end if;
end 
$$;


